package com.coding.challenge.dp;

class VowelsOfAllSubstrings {
	VowelsOfAllSubstrings() {
		throw new AssertionError();
	}

	public static void main(String[] args) {
		final String w1 = "aba";
		long vowelCnt = countVowels(w1);
		assert vowelCnt == 6;
		
		final String w2 = "abc";
		vowelCnt = countVowels(w2);
		assert vowelCnt == 3;

		final String w3 = "ltcd";
		vowelCnt = countVowels(w3);
		assert vowelCnt == 0;

		vowelCnt = countVowels("b");
		assert vowelCnt == 0;

		final String w4 = "";
		vowelCnt = countVowels(w4);
		assert vowelCnt == 32003263569662l;
	}

	static long countVowels(String word) {
		final int n = word.length();
		final long[] s = new long[n];
		long c = 0;
		// trivial case of the recursion, if there's only one letter in the word.
		s[0] = n;
		if (isVowel(word.charAt(0)))
			c = s[0];
		for (int i = 1; i < n; i++) {
			s[i] = (n - i) + (s[i - 1] - i);
			if (isVowel(word.charAt(i)))
				c = c + s[i];
		}

		return c;
	}

	static boolean isVowel(char ch) {
		return ch == 'a' || ch == 'e' || ch == 'i' || ch == 'o' || ch == 'u';
	}
}
